import Header from "@layoutStore/header";
import Navbar from "@layoutStore/navbar";

const CustomerPage = () => {
  return (
    <>
      <div className="w-[100vw] h-[100vh] relative">
        <Header></Header>
        <Navbar></Navbar>
        <div className="top-[20%] left-[18%] absolute">
          <div className="flex gap-x-52">
            <div className="btn-outline-primary">All Users</div>
            <div>Sellers</div>
            <div>Customers</div>
            <button className="btn-outline-primary px-5 py-2 border-2 border-[#0DB8DE] text-[#0DB8DE] transition duration-300 ease-in-out hover:bg-[#0DB8DE] hover:text-white font-bold">
            All Users
            </button>
            <button className="btn-outline-primary px-5 py-2 border-2 border-[#0DB8DE] text-[#0DB8DE] transition duration-300 ease-in-out hover:bg-[#0DB8DE] hover:text-white font-bold">
            Sellers
            </button>
            <button className="btn-outline-primary px-5 py-2 border-2 border-[#0DB8DE] text-[#0DB8DE] transition duration-300 ease-in-out hover:bg-[#0DB8DE] hover:text-white font-bold">
              LOGIN
            </button>
          </div>
        </div>
      </div>
    </>
  );
};
export default CustomerPage;
